import { Link } from 'react-router-dom';
import React from 'react';

import './styles.css';
import { LoginCard } from 'components/LoginCard';

const Home = () => {
    return (
        <>
        <div className="home-container">
            <Link to="/">
                <LoginCard buttonLabel="FAZER LOGIN" />
            </Link>
        </div>
        </>
    );
}

export default Home;
